contracts/HelloWorld.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract HelloWorld {
	string private value;

	function store(string memory newvalue) public {
		value = value;
	}
	function retrieve() public view returns(string memory) {
		return value;
	}
}

